import React from "react";
import { SideBar } from "../components/layouts";

function Home() {
  return (
    <>
      <SideBar>
        <div className="max-w-7xl mx-auto px-6 py-2 text-dark">
          <div className="w-full grid grid">
            <div className="">
              <input type="text" placeholder="search..." />
            </div>
            <div className="">
              <div className="">
                <button>export</button>
              </div>
              <div className="">
                <img src="" alt="" />
              </div>
            </div>
          </div>
        </div>
      </SideBar>
    </>
  );
}

export default Home;
